import React, { useState, useEffect } from 'react';
import '../styles.css'; // Importa el archivo de estilos CSS global

function GetStudentComponent (){
    const CatchName = (props) => {
        return props.name;
    };

    return (
        <div>
            <p>CatchName</p>
        </div>
    );
}

export default GetStudentComponent ();
